import React from "react";
import "./index.css";
var style={
    width: '65px',
    height: '65px',
}
function App(prop){
    return(<span>
  
            <span className="feedback">
                <img style={style} src={prop.imsrc} alt=""/>
                <h2>{prop.name}</h2>
                <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Obcaecati sunt harum est deleniti, quisquam
                    maxime. Lorem ipsum dolor sit amet consectetur, adipisicing elit. Provident rem, perspiciatis
                    explicabo consequatur ducimus totam!</p>
                <i>+92304547714</i>
                <p>{prop.city}</p>
            </span>
            
            
        </span>
    )}
export default App;
